import React from "react";
import { Router } from "react-router-dom";
import NavBar from "react-bootstrap/Navbar";
import Card from "react-bootstrap/Card";
import Container from "react-bootstrap/Container";
import { FontAwesomeIcon as FaIcon } from "@fortawesome/react-fontawesome";
import { faMountain } from "@fortawesome/free-solid-svg-icons";
import { useAuth0 } from "../react-auth0-spa";
import history from "./utils/history";

import synshorn_img from "../images/synshorn.jpg";
import mugnetind_img from "../images/mugnetind.jpg";

function App() {
  const { isAuthenticated, loginWithRedirect, logout } = useAuth0();
  return (
    <>
      <Router history={history}>
        <NavBar bg="dark" expand="md" collapseOnSelect>
          <NavBar.Brand style={{ color: "#f8f9fa" }}>
            <span
              style={{
                backgroundColor: "#f8f9fa",
                padding: "0.4rem",
                borderRadius: "0.1rem",
                color: "black",
              }}
            >
              <FaIcon
                icon={faMountain}
                style={{ marginRight: "0.4rem", color: "#343a40" }}
              ></FaIcon>
              Randohub
            </span>
          </NavBar.Brand>
          {!isAuthenticated && (
            <button onClick={() => loginWithRedirect({})}>Log in</button>
          )}
          {isAuthenticated && <button onClick={() => logout()}>Log out</button>}
        </NavBar>
        <div
          style={{
            width: "100vw",
            minHeight: "100vh",
            backgroundColor: "black",
          }}
        >
          <Container style={{ padding: "1rem 0" }}>
            <Card
              style={{
                padding: "1rem",
                margin: "1rem 0",
                width: "27rem",
                maxWidth: "100%",
              }}
              bg="dark"
            >
              <Card.Img
                src={synshorn_img}
                style={{ width: "100%", paddingBottom: "1rem" }}
              />
              <Card.Title style={{ color: "#f8f9fa" }}>
                Synshorn 1475
              </Card.Title>
              <Card.Body style={{ color: "#f8f9fa" }}>
                Det regnet og var nice
              </Card.Body>
            </Card>
            <Card
              style={{
                padding: "1rem",
                margin: "1rem 0",
                width: "27rem",
                maxWidth: "100%",
              }}
              bg="dark"
            >
              <Card.Img
                src={mugnetind_img}
                style={{ width: "100%", paddingBottom: "1rem" }}
              />
              <Card.Title style={{ color: "#f8f9fa" }}>
                Mugnetind 1740
              </Card.Title>
              <Card.Body style={{ color: "#f8f9fa" }}>
                Det regnet ikke og var nice
              </Card.Body>
            </Card>
          </Container>
        </div>
      </Router>
    </>
  );
}

export default App;
